import React from 'react';
import { Sidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';
import styles from '../styles/sidebar.module.css'; // Make sure the path is correct

const CustomSidebar = () => {
  return (
    <Sidebar className={styles.container}>
      <Menu>
        <SubMenu title="Charts" className={styles.subMenu}>
          <MenuItem className={styles.menuItem}>Pie charts</MenuItem>
          <MenuItem className={styles.menuItem}>Line charts</MenuItem>
        </SubMenu>
        <MenuItem className={styles.menuItem}>Documentation</MenuItem>
        <MenuItem className={styles.menuItem}>Calendar</MenuItem>
      </Menu>
    </Sidebar>
  );
}

export default CustomSidebar;
